Applications for provisional export licences lodged pursuant to Regulation (EC) No 1519/2005 in respect of the product groups and quotas identified by 16-Tokyo, 16-, 17-, 18-, 20- and 21-Uruguay, 25-Tokyo and 25-Uruguay in column 3 of the Annex to this Regulation shall be accepted subject to:
— the application of the allocation coefficients laid down in column 5 of the Annex to this Regulation, when they are submitted by applicants who provide evidence that they have exported the products in question to the United States of America during at least one of the preceding three years and whose designated importers are their subsidiaries or deemed to be subsidiaries pursuant to the sixth subparagraph of Article 20(2) of Regulation (EC) No 174/1999;
— the application of the allocation coefficients laid down in column 6 of the Annex to this Regulation, when they are submitted by applicants other than those referred to in the first indent of this Article who provide evidence that they have exported the products in question to the United States of America during each of the preceding three years.

Applications for provisional export licences lodged pursuant to Regulation (EC) No 1519/2005 in respect of the product groups and quotas identified by 22-Tokyo and 22-Uruguay in column 3 of the Annex to this Regulation shall be accepted subject to:
— the application of the allocation coefficients laid down in column 7 of the Annex to this Regulation, when they are submitted by applicants who provide evidence that they have exported cheese to the United States of America during at least one of the preceding three years and whose designated importers are their subsidiaries;
— the application of the allocation coefficients laid down in column 8 of the Annex to this Regulation, when they are submitted by applicants other than those referred to in the first indent of this Article who provide evidence that they have exported cheese to the United States of America during at least one of the preceding three years.
